import { useState, useEffect } from 'react';
import {
  Dialog,
  DialogPanel,
  PopoverGroup,
} from '@headlessui/react';
import {
  Bars3Icon,
  XMarkIcon,
} from '@heroicons/react/24/outline';
import { PhoneIcon, PlayCircleIcon } from '@heroicons/react/20/solid';
import { Inter } from 'next/font/google';
import LoginForm from './loginForm';
import { useRouter } from 'next/navigation';
async function loader() {
  const Path = '/api/nvigation-bar';
  const BASE_URL = 'http://localhost:1337';
  const url = new URL(Path, BASE_URL);
  const response = await fetch(url.href);
  const data = await response.json();
  console.log('data', data);
  return { ...data.data};
}

export default function NavigationHeader() {
  const router = useRouter();
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
    const [data, setData] = useState(null);

    useEffect(() => {
      // Fetch data on component mount
      async function fetchData() {
        const result = await loader();
        setData(result);
      }
      fetchData();
    }, []);

    if (!data) {
      return <div>Loading...</div>;
    }

    return (
      console.log('data123', data),
      <div >
        <header style={{height: '10vh', width: '100vw'}}>

          <nav aria-label="Global" className="mx-auto flex max-w-9xl items-center justify-between p-6 lg:px-8" style={{ height:'10vh',width: '100%' }}>

            <div className="flex lg:flex-1">
              <a className="-m-1.5 p-1.5">
                <img
                  alt=""
                  src="/Logo.png"
                  className="h-8 w-auto"
                />
              </a>
              <a className="-m-1.5 p-1.5">
                <img
                  alt=""
                  src="/company.png"
                  className="h-8 w-auto"
                />
              </a>

            </div>

            <div className="flex lg:hidden">
              <button
                type="button"
                onClick={() => setMobileMenuOpen(true)}
                className="-m-2.5 inline-flex md:hidden items-center justify-center rounded-md p-2.5 text-gray-700"
              >
                <span className=" sr-only"></span>
                <Bars3Icon aria-hidden="true"  className="size-6"/>
              </button>
            </div>

            <PopoverGroup className="hidden md:flex md:gap-x-8">
              <a href="/product" className="text-sm/6  text-gray-900" style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '16px', Lineheight: '23px', Letter: '1%' }}>
                {data.products}
              </a>
              <a href="/aboutus" className="text-sm/6 text-gray-900" style={{ color: 'rgb(0, 0, 0, 0.6)',fontFamily: 'Inter', fontSize: '16px', Lineheight: '23px', Letter: '1%' }}>
                {data.aboutus}
              </a>
              <a href="/blog" className="text-sm/6  text-gray-900" style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '16px', Lineheight: '23px', Letter: '1%' }}>
                {data.blog}
              </a>
              <a href="/resources" className="text-sm/6  text-gray-900" style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '16px', Lineheight: '23px', Letter: '1%' }}>
                {data.resources}
              </a>
              <a href="/bookcall" className="text-sm/6  text-gray-900" style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '16px', Lineheight: '23px', Letter: '1%' }}>
                {data.bookCall}
              </a>
            </PopoverGroup>

            <button
              className="hidden md:inline-flex items-center justify-center rounded-md bg-black px-5 py-2 text-sm font-semibold text-white shadow-sm hover:bg-gray-900 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
              style={{ marginLeft: '24px', width: '115px', height: '39px', borderRadius: '10px', padding: '10px 15px' }}
              onClick={() => router.push('/login')}
            >
              Sign in
            </button>

          </nav>

          <Dialog open={mobileMenuOpen} onClose={setMobileMenuOpen} className="lg:hidden">

            <div className="fixed inset-0 z-20" />

            <DialogPanel className="fixed inset-y-0 right-0 z-10 w-full overflow-y-auto bg-white px-6 py-6 sm:max-w-sm sm:ring-1 sm:ring-gray-900/10">
              <div className="flex items-center justify-between">
                <a href="#" className="-m-1.5 p-1.5">
                  <span className="sr-only">Your Company</span>
                  <img
                    alt=""
                    src="/Group.png"
                    className="h-8 w-auto"
                  />
                </a>
                <button
                  type="button"
                  onClick={() => setMobileMenuOpen(false)}
                  className="-m-2.5 rounded-md p-2.5 text-gray-700"
                >
                  <span className="sr-only">Close menu</span>
                  <XMarkIcon aria-hidden="true" className="size-6" />
                </button>
              </div>
              <div className="mt-6 flow-root">
                <div className="-my-6 divide-y divide-gray-500/10">
                  <div className="space-y-2 py-6">
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2 text-base/7 font-medium text-gray-900 hover:bg-gray-50"
                      style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%' }}
                    >
                      {data.products}
                    </a>
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2 text-base/7 font-semibold text-gray-900 hover:bg-gray-50"
                      style={{  color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%' }}
                    >
                      {data.aboutus}
                    </a>
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2 text-base/7 font-semibold text-gray-900 hover:bg-gray-50"
                      style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%' }}
                    >
                      {data.blog}
                    </a>
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2 text-base/7 font-semibold text-gray-900 hover:bg-gray-50"
                      style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%'}}
                    >
                      {data.resources}
                    </a>
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2 text-base/7 font-semibold text-gray-900 hover:bg-gray-50"
                      style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%' }}
                    >
                      {data.bookCall}
                    </a>
                  </div>
                  <div className="py-6">
                    <a
                      href="#"
                      className="-mx-3 block rounded-lg px-3 py-2.5 text-base/7 font-semibold text-gray-900 hover:bg-gray-50"
                      style={{ color: 'rgb(0, 0, 0, 0.6)', fontFamily: 'Inter', fontSize: '14px', Lineheight: '23px', Letter: '1%' }}
                    >
                      Sign in
                    </a>
                  </div>
                </div>
              </div>
            </DialogPanel>

          </Dialog>

        </header>
      </div>
    );
    }
